import React from 'react';
import './App.css';
import Signup from './Component/Signup';
import Login from './Component/Login';
import Experiences from './Component/Experiences'
import { Route , Link , Switch} from 'react-router-dom';

function App() {
  return (

    <div className="App">

      <div className='Links'>
         <Link className='sign-link' to='/Signup'> Sign-Up </Link>
         <Link className='login-link' to='/Login'> Login </Link>
         <Link className='login-link' to='/Experiences'> Experiences</Link>
      </div>
      <Route exact path= '/Signup' component={Signup}Signup />
      <Route exact path= '/Login' component={Login}Login />
      <Route exact path= '/Experiences' component={Experiences}Experiences />

    </div>

  );
}

export default App;
